    <script src="https://cdn.jsdelivr.net/npm/canvas-confetti/dist/confetti.browser.min.js"></script>
    <script>
        setTimeout(() => {
            setInterval(() => {
                sprinkles()
            }, 3000)
        }, 6000)


        function sprinkles() {
            confetti({
                particleCount: 200,
                spread: 1000 + Math.random() * 300,
                startVelocity: 25 + Math.random() * 10,
                angle: 0 + (Math.random() * 20 - 10),
                ticks: 900,
                origin: { x: 0 + Math.random() * 0.02, y: 0.5 }
            });

            confetti({
                particleCount: 100,
                spread: 1000 + Math.random() * 300,
                startVelocity: 25 + Math.random() * 10,
                angle: 180 + (Math.random() * 20 - 10),
                ticks: 900,
                origin: { x: 1 - Math.random() * 0.02, y: 0.5 }
            });
            confetti({
                particleCount: 200,
                spread: 1000 + Math.random() * 300,
                startVelocity: 25 + Math.random() * 10,
                angle: 180 + (Math.random() * 10 + 5),
                ticks: 900,
                origin: { x: 1 + Math.random() * 0.02, y: 0 }
            });
            confetti({
                particleCount: 100,
                spread: 1000 + Math.random() * 300,
                startVelocity: 25 + Math.random() * 10,
                angle: 0 + (Math.random() * 120 + 5),
                ticks: 900,
                origin: { x: 0 + Math.random() * 0.02, y: 1 }
            });
        }

        window.addEventListener("click", () => {
            document.querySelector("audio")?.play();
        }, { once: true });
    </script>
